import React from 'react';
import {Navbar} from '../../common';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faFacebook,
    faTw
} from '@fortawesome/free-brands-svg-icons';

import './Header.css';
function Header (){
    return(
        <section className="header-name">
            <h1 className="header-name-title">InstaFill</h1>
            <h1 className="header-name-item">Form Magic!</h1>
            <section className="header-socials">
            <FontAwesomeIcon icon={['fab', 'microsoft']} />
            <h1 className="header-socials-item">Instagram</h1>
            <h1 className="header-socials-item">Facebook</h1>
            </section>

        </section>
    )
}
export default Header;
